import { Fragment } from 'react';
import React from 'react';
import './Header.css';
import logo from '../../Assets/logo.png';

const Header=()=>{
    
    return(
            <Fragment>
                <div className="Header">
                    <div className='logo'>
                        <img src={logo}></img>
                    </div>
                <div className="Option">
                    <a href='#'>Home</a>
                    <a href='#'>Resources</a>
                    <a href='#'>Skills</a>
                    <a href='#'>About Me</a>
                </div>
                </div>
            </Fragment>
    );
};

export default Header;
